import React from 'react';
import { View } from 'react-native';

function Line() {
    return (
        <br>
        <View style={{
            height: 3,
            backgroundColor: 'rgba(0, 0, 0 , 1)',
            alignSelf: 'stretch'
        }} /></br>
    )
}

export default Line;
